ht.columns.drawCell:
__ht__function(g, text, rect, option) {
            var font = option.font,
                color = '#27BE8A',
                x = rect.x,
                y = rect.y,
                height = rect.height,
                width = rect.width,
                ts2 = ht.Default.getTextSize(font, '00'),
                texts = text.split('-');
                  ht.Default.drawText(g, texts[0], font, color, x , y, width/2, height, 'right', 'middle');
                 if (texts.length > 1) {
                     ht.Default.drawText(g, texts[1], font, '#fff', x + width/2 , y, width/2 + ts2.width, height, 'left', 'middle');
                 }
        }

